export default () => {
	return (
		<div className="subscribe">
			<h2>
				Leave us your phone or email, and we will notify you there are
				infected near by.
			</h2>
			<style jsx>{`
				.subscribe {
					position: absolute;
				}
			`}</style>
		</div>
	);
};
